import { createAction, props } from '@ngrx/store';
import { ElementList } from 'app/interfaces/bootstrap';

export const addPlayers = createAction('[Elements API] Add all Players',
  props<{
    elements: ElementList;
  }>()
);
export const addPicks = createAction('Add Picks');
